import React from 'react';


const Navigation = ({ onRouteChange, isSignedIn }) => {

    if (isSignedIn) {
        return (
            <nav style={{ display: "flex", justifyContent: 'flex-end', }}>

                <p onClick={() => onRouteChange("home")} className="f3 link dim black underline pa3 pointer" style= {{zIndex: "2"}}>Sign Out</p>

            </nav>
        );

    } else {

        return (

             <nav style={{ display: "flex", justifyContent: 'flex-end', }}>

            <p onClick={() => onRouteChange("SignIn")} className="f3 link dim black underline pa3 pointer" style= {{zIndex: "2"}}>Sign In</p>
            <p onClick={() => onRouteChange("Register")} className="f3 link dim black underline pa3 pointer" style= {{zIndex: "2"}}>Register</p>

            </nav>

        );

    }


}

export default Navigation
